import Server from "../server";
import request from "supertest";

let code;
let token;

describe("Authentication API", () => {
  //body request malformed
  it("Login API request must fail with 400", async () => {
    request(Server).post("/api/v1/auth/login")
      .send({ username: "rick11", password: "1234" }).then(res => {
        expect(res.status).toEqual(400)
      })
  });
  //must return 401, unauthorized, wrong credentials
  it("Login API request must fail with 401", async () => {
    request(Server).post("/api/v1/auth/login")
      .send({ user_name: "rick11", password: "1234" }).then(res => {
        expect(res.status).toEqual(401);

      })
  })
  //must return 200, nutritionist registered

  it("Register nutritionist must return 200", async () => {
    request(Server).post("/api/v1/auth/")
      .send({
        "user_name": "rick",
        "first_name": "Ricardo Manuel",
        "last_name": "Perez Plata",
        "password": "1234",
        "email": "ricardompp11@gmail.com",
        "phone": "7225355983",
        "gender": "Hombre",
        "birthDate": "11/11/1996",
        "countrie": "Mexico",
        "state": "Mexico",
        "citie": "Toluca",
        "dataType": "data:image/png;base64",
        "image": ""
      }).then(res => {
        expect(res.status).toEqual(200)
        code = res.body.confirmation_code;
      })
  })
  //return error 400, username and phone already registered
  it("Register nutritionist must return 400", async () => {
    request(Server).post("/api/v1/auth/")
      .send({
        "user_name": "rick",
        "first_name": "Ricardo Manuel",
        "last_name": "Perez Plata",
        "password": "1234",
        "email": "ricardompp11@gmail.com",
        "phone": "7225355983",
        "gender": "Hombre",
        "birthDate": "11/11/1996",
        "countrie": "Mexico",
        "state": "Mexico",
        "citie": "Toluca",
        "dataType": "data:image/png;base64",
        "image": ""
      }).then(res => {
        expect(res.status).toEqual(400)
        expect(res.body).toEqual({
          "errors": {
            "user_name": "User already taked",
            "phone": "Phone already registered",
            "length": 2
          }
        })
      })
  })

  //return 400 univerified user
  it("Login with unverified user", async () => {
    request(Server).post("/api/v1/auth/login")
      .send({
        "user_name": "rick",
        "password": "1234"
      }).then(res => {
        expect(res.status).toEqual(400)
        expect(res.body).toEqual({
          "error": "Debe verificar su usuario"
        })
      })
  })

  //return 400, wrong confirmation code
  it("User confirmation with wrong code", async () => {
    request(Server).post("/api/v1/auth/verify")
      .send({ user_name: "rick", code: "1234" })
      .then(res => {
        expect(res.status).toEqual(400)
        expect(res.body).toEqual({ message: "Codigo erroneo" })
      })
  })

  //returns 200, rigth verification code
  it("User confirmation with right code", async () => {
    request(Server).post("/api/v1/auth/verify")
      .send({ user_name: "rick", code: code })
      .then(res => {
        expect(res.status).toEqual(200)
      })
  })

  //returns 200, user verified
  it("Login with verified user", async () => {
    request(Server).post("/api/v1/auth/login")
      .send({
        "user_name": "rick",
        "password": "1234"
      }).then(res => {
        expect(res.status).toEqual(200)
        token = res.body.token
      })
  })

  //returns 401, no token provided
  it("Request profile with no jwt", async () => {
    request(Server).get("/api/v1/auth/get-nutritionist-profile/rick")
      .then(res => {
        expect(res.status).toEqual(401)
      })
  })
  //returns 200, token provided
  it("Request profile with  jwt", async () => {
    request(Server).get("/api/v1/auth/get-nutritionist-profile/rick")
    .set('Authorization',`Bearer ${token}`)
      .then(res => {
        expect(res.status).toEqual(200)
      })
  })
});



